import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css'; // Import your CSS for styling

function VolunteerPointsDashboard() {
  return (
    <div className="dashboard-container">
      <h1>Volunteer Points Management</h1>
      <div className="dashboard-buttons">
        <Link to="/add-points" className="dashboard-button">Add Volunteer Points</Link>
        <Link to="/check-history" className="dashboard-button">Check Volunteer History</Link>
        <Link to="/reward-checkin" className="dashboard-button">Reward Check-in</Link>
      </div>
    </div>
  );
}

export default VolunteerPointsDashboard;
